import { React } from 'react';
import NavBar from './components/NavBar/NavBar'
import Hero from './components/Hero/Hero';
import Particles from 'react-particles-js';


function App() {
  return (
    <div>
      <Particles 
                params={{
                    polygon: {
                        enable: true,
                        type: 'inside',
                        move: {
                            radius: 10
                        },
                        url: 'path/to/svg.svg'
                    }
                }} />
      <NavBar />
      <Hero />
    </div>
  );
}



export default App;
